<style>
/* 右告知用バルーン*/
#balloon-2-bottom {
	position: relative;
	padding: 0 15px;
	height: 40px;
	color: #ffffff;
	line-height: 40px;
	text-align: center;
	background-color:#900;
	z-index: 0;
	margin: 0px 0px 20px 0px;
}
#balloon-2-bottom:after {
	content: "";
	position: absolute;
	bottom: -10px; left: 50%;
	margin-left: -10px;
	display: block;
	width: 0px;
	height: 0px;
	border-style: solid;
	border-width: 10px 10px 0 10px;
	border-color: #900 transparent transparent transparent;
}

#kokuti-1{
	position:fixed;
	bottom:10%;
	right:0%;
	line-height: 10px;
    font-size: 8px;
    font-weight: bold;
}

