リーフスプリング車のロワードには欠かせません。<br>
1インチから4インチまでのブロックの用意があります。<br><br>

2インチと3インチはスタンダードブロックとスモールブロックがあるので各部サイズを御確認の上オーダーして下さい。<br>
又、Uボルトやスモールブロックのみでの販売も行っています。<br>
ユニバーサルタイプで 車種別専用キットではありません。<br>
<br>
＊200系ハイエース用、100系ハイエース用登場！<br>
＊キャラバン等ワンボックス車には装着出来ません。<br>詳しくはお手数ですがお問い合わせ下さい。<br><br>

なお、たとえリーフスプリング車でも、リーフの下にホーシングがある車や横置きリーフ車等には取り付け不可能な車種があったり、場合によっては表示通りのLoweredができない場合もあります。<br>
ドロップ数はあくまでも目安としてお考え下さい。<br>
<br>
※以下の車種はスモールキットをお使い下さい。<br>
ジムニー / マイティーボーイなどの Kカー。<br>
カローラ / カルディナ / セレナ / パブリカ / サニートラックなど、その他リーフスプリングの幅が狭い車種。<br><style type="text/css">
